package com.company.project.common.model;import java.util.ArrayList;import java.util.List;/** * Created by Viki.Feng on 21/01/2016. */public class ListResultModel<T> extends CommonResultModel {    private long totalRecords;    private List<T> data;    public ListResultModel() {        totalRecords = 0;        data =  new ArrayList<T>();    }    public long getTotalRecords() {        return totalRecords;    }    public void setTotalRecords(long totalRecords) {        this.totalRecords = totalRecords;    }    public List<T> getData() {        return data;    }    public void setData(List<T> data) {        this.data = data;    }}